```
ofstream out("myfile.dat", ios::binary);
out.write(data, 1000);
out.close();
```
To load only the first 1000 bytes of a file, you can use the following code:
```
ifstream in("myfile.dat", ios::binary);
char data[1000];
in.read(data, 1000);
in.close();
```
If you want to save or load data in larger chunks, you can simply increase the size of the data array and the number of bytes that you write or read.

